import { Button, Stack, Typography } from "@mui/material";
import React from "react";
import SendIcon from "@mui/icons-material/Send";
import ManageAccountsIcon from '@mui/icons-material/ManageAccounts';

export interface LoginPageProps {
  loginHandler: () => void;
}
export const LoginPage: React.FC<LoginPageProps> = ({ loginHandler }) => {
  return (
    <Stack alignItems="center" spacing={5} sx={{ marginTop: "30px" }}>
      <Typography variant="h3"> Welcome to safety manager  {<ManageAccountsIcon fontSiz="20" />} </Typography>
      <Button onClick={loginHandler} variant="contained" endIcon={<SendIcon />}>
        Login With Google
      </Button>
    </Stack>
  );
};
